import { Col, Row } from "antd";
import TodoNavbar from "features/TodoNavbar/ui/TodoNavbar";
import TodoList from "widgets/TodoList/ui/TodoList";

const TodoMain = () => {

    return (
        <Row
            justify="center"
            align="middle"
            style={{
                position: "absolute",
                top: 0,
                bottom: 0,
                right: 0,
                left: 0,
            }}
        >
            <Col span={12}>
                <TodoNavbar />
                <TodoList />
            </Col>
        </Row>
    );
};
export default TodoMain;
